script: |
  super -f text -I q5678.spq | sort > q5678.out

inputs:
  - name: q5678.spq
    data: |
      SELECT ALL + ( + COUNT ( * ) ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q5678.out
    data: |
      9
